import { IconButton, Stack, useTheme, useMediaQuery } from "@mui/material";
import HomeRoundedIcon from "@mui/icons-material/HomeRounded";
import TagRoundedIcon from "@mui/icons-material/TagRounded";
import AccountCircleRoundedIcon from "@mui/icons-material/AccountCircleRounded";
import { ReactComponent as Logo } from "../icons/logo.svg";
import BookmarkBorderRoundedIcon from "@mui/icons-material/BookmarkBorderRounded";
import NotificationsNoneRoundedIcon from "@mui/icons-material/NotificationsNoneRounded";

import { useState } from "react";
import BottomNavigation from "@mui/material/BottomNavigation";
import BottomNavigationAction from "@mui/material/BottomNavigationAction";
import FolderIcon from "@mui/icons-material/Folder";
import RestoreIcon from "@mui/icons-material/Restore";
import FavoriteIcon from "@mui/icons-material/Favorite";
import LocationOnIcon from "@mui/icons-material/LocationOn";

export default function LabelBottomNavigation() {
  const [value, setValue] = useState("recents");

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <BottomNavigation sx={{ width: 500 }} value={value} onChange={handleChange}>
      <BottomNavigationAction
        label="Recents"
        value="recents"
        icon={<RestoreIcon />}
      />
      <BottomNavigationAction
        label="Favorites"
        value="favorites"
        icon={<FavoriteIcon />}
      />
      <BottomNavigationAction
        label="Nearby"
        value="nearby"
        icon={<LocationOnIcon />}
      />
      <BottomNavigationAction
        label="Folder"
        value="folder"
        icon={<FolderIcon />}
      />
    </BottomNavigation>
  );
}

export const Navbar = () => {
  const theme = useTheme();
  const matches = useMediaQuery(theme.breakpoints.down("sm"));
  console.log(matches);
  const icons = [
    {
      logo: (
        <Logo
          fill={theme.palette.primary.main}
          width={"30px"}
          height={"30px"}
        />
      ),
      href: "/home",
    },
    {
      logo: <HomeRoundedIcon fontSize="large" />,
      href: "/home",
    },
    {
      logo: <TagRoundedIcon fontSize="large" />,
      href: "/explore",
    },
    {
      logo: <AccountCircleRoundedIcon fontSize="large" />,
      href: "/explore",
    },
    {
      logo: <BookmarkBorderRoundedIcon fontSize="large" />,
      href: "/saved",
    },
    {
      logo: <NotificationsNoneRoundedIcon fontSize="large" />,
      href: "/notifications",
    },
  ];

  return (
    <Stack
      minWidth={"75px"}
      spacing={1.5}
      sx={{
        backgroundColor: "rgba(255,255,255,0.07)",
        position: "fixed",
        maxHeight: "100vh",
      }}
      height={"100vh"}
      pt={2}
    >
      {icons.map((d, i) => {
        return (
          <IconButton color="primary" key={i} href={d.href}>
            {d.logo}
          </IconButton>
        );
      })}
    </Stack>
  );
};
